__NUXT_JSONP__("/svet/mesto/viden", (function(a,b){return {data:[{place:[{id:101,id_state:12,name:"Vídeň",population:1911728,area:414.78,altitude:171,id_continent:a,id_administrative_unit:a,id_districts:a,slug:"viden",information_chatgpt:"Vídeň je hlavním městem Rakouska a s více než 1,9 miliony obyvatel největším městem země. Leží na východě Rakouska na řece Dunaji a je významným kulturním, politickým a ekonomickým centrem střední Evropy.\n\nVídeň je známá svou architekturou, zejména barokními a secesními stavbami, a je domovem mnoha významných kulturních institucí, včetně opery, divadel a galerií. Město je také známé svým historickým dědictvím, včetně Hofburgu, bývalého císařského paláce, a Stephansdomu, gotické katedrály.\n\nVídeň je také důležitým centrem v oblasti vzdělání, vědy a výzkumu a má řadu prestižních univerzit a výzkumných institucí. Město je také známé svou kulinářskou scénou, včetně kávových domů, cukráren a restaurací, které nabízejí rakouskou kuchyni a další kuchyně z celého světa.\n\nVídeň je také důležitým dopravním uzlem, s mezinárodním letištěm a řadou dálnic a železničních tratí. Město je také známé svým veřejným dopravním systémem, včetně tramvají, autobusů a metra.",image_cover:b,image_hero:b}]}],fetch:{},mutations:void 0}}(null,"https:\u002F\u002Fimage.frytolnacestach.cz\u002Fstorage\u002Fworld\u002Fcities\u002Fviden.jpg")));